import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import ProfilePage from './pages/ProfilePage';

const App: React.FC = () => {
  return (
    <Router>
      <Routes>
        <Route path="/profile" element={<ProfilePage name="Ahmet" email="ahmet@example.com" />} />
      </Routes>
    </Router>
  );
};

export default App;
